import React from 'react';
import classes from "./Area.module.css";

const Area = () => {
    return (
        <div className= {classes.area}>
            <div className= {classes.textBlock}>
                <h1>
                Поиск и проверка работы заграницей
                </h1>
            </div>
        </div>
    );
}

export default Area;
